
create schema if not exists data_sci;

set search_path to data_sci;

drop table if exists company_departments;
create table company_departments (
	id integer,
    department_name text,
    division_name text,
    primary key (id)
  );



drop table if exists company_regions;
create table company_regions (
	id integer,
	region_name text,
	country_name text,
	primary key (id)
	);



drop table if exists employees;
create table employees
  (
      id integer,
      last_name text,
      email text,
      start_date date,
      salary integer,
      job_title text,
      region_id integer,
      department_id integer,
      primary key(id)
  );

create index idx_emp_depatment on employees(department_id);
create index idx_emp_region on employees(region_id);


